import React from 'react';

function TaskItem(props) {
    const {task, index} = props;
    return (
        <tbody>
            <tr>
                <td>{index}</td>
                <td>{task.task}</td>
                <td>
                    {
                        task.status 
                        ?   "Kích hoạt"
                        :   "Ẩn"
                    }
                </td>
                <td>
                    <button type="submit" className="btn green">Sửa</button>
                    <button type="submit" className="btn red">Xóa</button>
                </td>
            </tr>
        </tbody>
    );
}

export default TaskItem;
